import { useEffect, useState } from "react";

function Header() {
  return (
      <div>
          <div>
          <button>모집</button>
          <button>세션</button>
          <button>연합공연</button>
          <button>음악분석</button>
          </div>
          <div>대일밴드</div>
          <div>
              <input>검색창</input>
              <button>로그인</button>
              <button>마이페이지</button>
          </div>
          
    </div>
  );
}

export default Header;
